import React from "react";
import ReactDOM from "react-dom";
import Jacy from "./views/Jacy";

function App() {
  return (
    <>
      <Jacy />
      <Button>Hello bold</Button>
    </>
  );
}

ReactDOM.render(<App />, document.getElementById("root"));
